import {
  Route,
  Routes,
  Link,
} from 'react-router-dom';


import Landing from "./components/landing";


function App() {
  return (
    <>
    <Routes>
      <Link to="/"> welcome </Link>
      <Route path="/" element={<Landing/>} />
    </Routes>

    <div className="App">

      Hello! this is Raphael...
    </div>
    </>
  );
}

export default App;
